import React from "react";
import "./App.css";
import Subscribers from "./components/Subscribers";
import { Provider } from "react-redux";
const App = () => {
  return (
    <Provider>
      <div className="App">
        <Subscribers />
      </div>
    </Provider>
  );
};

export default App;
